  \"Non Intrrusive, On-line, Simultaneous Multi-Species Impurity Monitor in Hydrogen
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\": 2\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-05-06T22:36:12.372141\",\n\t\"name\":
  \"non-intrrusive-on-line-simultaneous-multi-species-impurity-monitor-in-hydrogen-project-ba15b\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The purity of hydrogen fuel is important
  in engine testing at SSC. The hydrogen may become contaminated with nitrogen, argon,
  helium or oxygen. The hydrogen from the fuel tank  s or feed lines is analyzed beforehand.
  Therefore, there is a need for a non-intrusive, on-line, near real-time monitor
  for H2. The analytical technique should measure various impurities (molecular and
  atomic) simultaneously and be easy to implement in the field. The objective of this
  proposed research is to develop an analytical technique based on Laser Induced Breakdown
  Spectroscopy (LIBS) to measure simultaneously the concentrations of nitrogen (N2),
  argon (Ar), Helium (He) and oxygen (O2) contaminants in hydrogen (H2) gas storage
  tanks and supply lines. Advanced sensors for monitoring multiple species in H2 feed-lines
  and storage tanks will be useful before engine testing and will increase understanding
  of engine performance. Phase I has provided necessary information to build a sensitive,
  compact, sturdy, user-friendly and fieldable prototype in Phase II, with ease of
  implementation at NASA/SSC. In Phase II, a prototype LIBS system will be designed
  and fabricated to measure impurities in H2 fuel at different places in the H2 feed
  line. This integrated system will be delivered to NASA/SSC at the end of Phase II.\",\n\t\"license_title\":
